import "./Example.css";

const Example = ({ exampleType, titleText, paragraphText, imgSrc }) => {
  <div className={`example ${exampleType}`}>
    <div className={`examples-text ${exampleType}-text`}>
      <h1>{titleText}</h1>
      <p>{paragraphText}</p>
    </div>
    <img src={imgSrc} />
  </div>;
};

export default Example;
